// Focus next input element
function moveToNext(currentInput, nextInputId) {
  const maxLength = parseInt(currentInput.getAttribute("maxlength"));
  const currentLength = currentInput.value.length;

  if (currentLength >= maxLength) {
    const nextInput = document.getElementById(nextInputId);
    if (nextInput) {
      nextInput.focus();
    }
  }
}

// Ensure input lengths are not greater than 4 characters
const input = document.querySelectorAll(".num-input");
[...input].map((el) =>
  el.addEventListener("input", function () {
    if (this.value.length > 4) {
      this.value = this.value.slice(0, 4);
    }
  })
);

// cardLogo.innerHTML = visa;

const monthSelect = document.getElementById("monthSelect");
const yearSelect = document.getElementById("yearSelect");
const currentYear = new Date().getFullYear();
const startYear = 2020;
const endYear = currentYear + 10;

// Populate months option with numbers 1 to 12
for (let month = 1; month <= 12; month++) {
  const option = document.createElement("option");
  option.value = `${month < 10 ? 0 : ""}${month}`;
  option.textContent = `${month < 10 ? 0 : ""}${month}`;
  monthSelect.appendChild(option);
}

// Populate years option with years from 2020 to 2030
for (let year = startYear; year <= endYear; year++) {
  const option = document.createElement("option");
  option.value = (year + "").slice(2, 4);
  option.textContent = year;
  yearSelect.appendChild(option);
}
